import React from 'react'
import './tradeblock.css'
import TBteamCard from './TBteamCard'

const TBnba = (props) => {
    //props
    const teams = props.teams

    return(
        <div className="TBnba">
            {teams.map(t => {
                return <TBteamCard t={t} />
            })}
        </div>
    )
}

export default TBnba
